import React from "react";
import {
  AboContainer,
  Abowrapper,
  AboRow,
  Column1,
  textWrapper,
  Heading,
  Subtitle,
  TopLine,
} from "./AboutElements";
import { Button } from "react-scroll";

export const AboutSection = () => {
  return (
    <>
      <AboContainer>
        <Abowrapper>
          <AboRow>
            <Column1>
              <textWrapper>
                <TopLine>TopLine</TopLine>
                <Heading>Heading</Heading>
                <Subtitle>Subtitle</Subtitle>
                {/* <Button to="home">buttun</Button> */}
              </textWrapper>
            </Column1>
          </AboRow>
        </Abowrapper>
      </AboContainer>
    </>
  );
};
